import { createApp } from 'vue'
import App from './App.vue'
import './index.css'
import anime from 'animejs/lib/anime.es.js';

createApp(App).mount('#app')

/* ANIMATIONS */

let title = anime.timeline({
    targets: '.text-title'
});
title.add({
    scale: 0.2,
    duration: 1500
})

title.add({
    scale: 1,
    duration: 800
})
